import React, {useState, useEffect } from 'react';
import '../../App.css';
import { Container,Row } from "react-bootstrap";
import AdminNavigation from '../../components/AdminNavigation';
import { Line } from "react-chartjs-2";
import axios from "axios";

export default function AdminDashboard(){

  const [chartData, setChartData] = useState({});
  const [vaccine_id, setVaccine_id] = useState([]);
  const [available, setAvailabile] = useState([]);

  const chart = () => {
    let vaccine_id = [];
    let available = [];
    axios.get('http://localhost:3001/vaccine')
      .then(res => {
        console.log(res);
        for (const dataObj of res.data.data) {
          vaccine_id.push(parseInt(dataObj.vaccine_id));
          available.push(parseInt(dataObj.available));
        }
        setChartData({
          labels: vaccine_id,
          datasets: [
            {
              label: "Vaccine Availability",
              data: available,
              backgroundColor: ["rgba(75, 192, 192, 0.6)"],
              borderWidth: 4,
              

            }
          ]
         
        });
      })
      .catch(err => {
        console.log(err);
      });
    console.log(vaccine_id, available);
  };

  useEffect(() => {
    chart();
  }, []);
  return (
    <div className="App">
      <h1>Dankmemes</h1>
      <div>
        <Line
          data={chartData}
          height={400}
          width={600}
          options={{
            maintainAspectRatio:false,
            responsive: true,
            title: { text: "Vaccine Availability", display: true },
            scales: {
              yAxes: [
                {
                  ticks: {
                    autoSkip: true,
                    maxTicksLimit: 10,
                    beginAtZero: true
                  },
                  gridLines: {
                    display: false
                  }
                }
              ],
              xAxes: [
                {
                  gridLines: {
                    display: false
                  }
                }
              ]
            }
          }}
        />
      </div>
    </div>
  );
};
